import * as React from 'react';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import CircularProgress from '@mui/material/CircularProgress';
import { Container, Typography, Button} from '@mui/material';
import axios from 'axios';
import testImage from './assets/1.png';

export default class ImageWindow extends React.Component{
    constructor(props){
        super(props)
        this.state = {
            image: props.image,
            mask: props.mask,
            uploadStatus: props.uploadStatus,
        }
    }

    nextImage(){
        axios.get("http://localhost:5000/next_image").then((res) => {
            if (res != "error"){
                console.log("next_image");
                this.setState({image: res.data})
            }
        }).catch((err) => alert("Request Error"));
    }

    prevImage(){
        axios.get("http://localhost:5000/prev_image").then((res) => {
            if (res != "error"){
                console.log("prev_image");
                this.setState({image: res.data})
            }
        }).catch((err) => alert("Request Error"));
    }

    nextMask(){
        axios.get("http://localhost:5000/next_mask").then((res) => {
            if (res != "error"){
                console.log("next_mask");
                this.setState({mask: res.data})
            }
        }).catch((err) => alert("Request Error"));
    }

    prevMask(){
        axios.get("http://localhost:5000/prev_mask").then((res) => {
            if (res != "error"){
                console.log("prev_mask");
                this.setState({mask: res.data})
            }
        }).catch((err) => alert("Request Error"));
    }


    render(){
        return(
            <Container maxWidth='lg' fixed>
                <Box 
                    width={'100%'}
                    height={450}
                    display="flex" 
                    alignItems="center"
                    justifyContent="center"
                    sx={{backgroundColor: 'secondary.main',
                        borderRadius: 3,
                        border: 1,
                        borderStyle: 'solid'
                    }}>
                    <CenterItem uploadStatus = {this.state.uploadStatus}/>
                    
                </Box>
            </Container>
        );
    }
}


function CenterItem(props){
    console.log("props:" + props.uploadStatus)
    if (props.uploadStatus == "not_uploaded"){
        return(
            <Typography>output image preview will be shown here after uploading.</Typography>
        );
    }else if (props.uploadStatus == "processing"){
        return(
            <CircularProgress color="primary" />
        );
    }else{
        return(
            <Container maxWidth='xl'>
            <Grid container spacing={2}>
                <Grid item xs={6}>
                    <img src={testImage}></img>
                    {/* <Box sx={{width: 475, height: 400}} backgroundImage={testImage} position='relative'/> */}
                </Grid>
                <Grid item xs={6}>
                    <img src={testImage}></img>
                    {/* <Box sx={{width: 475, height: 400}} backgroundImage={testImage} position='relative'/> */}
                </Grid>
            </Grid>

            <Grid container spacing={2}>
                <Grid item xs={6}>
                    <Button variant="outlined" fullWidth>NEXT</Button>
                </Grid>
                <Grid item xs={6}>
                    <Button variant="outlined" fullWidth>PREV</Button>
                </Grid>
            </Grid>
            </Container>
            
        )
    }
}
